import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { register } from '../services/auth';
import {  
  Typography, 
  IconButton,
  Button, 
  FormControl, 
  InputLabel, 
  OutlinedInput, 
  TextField, 
  InputAdornment, 
  Link, 
  Box
} from '@mui/material';
import AccountCircle from '@mui/icons-material/AccountCircle';
import Visibility from '@mui/icons-material/Visibility';
import VisibilityOff from '@mui/icons-material/VisibilityOff';

function CreerUtilisateur() {
  const navigate = useNavigate();
  const [message, setMessage] = useState('');
  const [loading, setLoading] = useState(false);
  const [showPassword, setShowPassword] = useState(false);

  const handleSignUp = async (event) => {
    event.preventDefault();
    setLoading(true);
    const formData = new FormData(event.currentTarget);
    const name = formData.get('name');
    const email = formData.get('email');
    const password = formData.get('password');
    const nom_famille = formData.get('nom_famille');

    try {
      await register(name, email, password, nom_famille);
      setMessage('Compte créé avec succès');
      navigate('/Home');
    } catch (error) {
      setMessage(error.response?.data?.message || 'Erreur lors de la création du compte');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div
      style={{
        minHeight: '100vh',
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
        padding: '16px',
        backgroundImage: 'url("https://media.istockphoto.com/id/479233129/fr/photo/personnes-dans-un-cours-de-cuisine.jpg?s=612x612&w=0&k=20&c=oCwjYRAgP8RRcFyQhSwfv7arCrHssBEVKLr6gZyxSj0=")',
        backgroundSize: 'cover',
        backgroundPosition: 'center',
        position: 'relative'
      }}
    >
      <div style={{ position: 'absolute', inset: 0, backgroundColor: 'rgba(255, 255, 255, 0.9)' }}></div>
      <div style={{ position: 'relative', zIndex: 1, width: '100%', maxWidth: '400px' }}>
        <Box component="form" onSubmit={handleSignUp} sx={{ mt: 3, mx: 'auto', p: 2, borderRadius: 1, boxShadow: 3, backgroundColor: 'white' }}>
          <Typography variant="h5" component="h1" gutterBottom textAlign="center" color='Grey'>
            Créer un compte
          </Typography>
          <TextField
            fullWidth
            label="Prénom"
            name="name"
            required
            sx={{ mb: 2 }}
          />
          <TextField
            fullWidth
            label="Nom de famille"
            name="nom_famille"
            required
            sx={{ mb: 2 }}
          />
          <TextField
            fullWidth
            label="Email"
            name="email"
            type="email"
            required
            InputProps={{
              startAdornment: (
                <InputAdornment position="start">
                  <AccountCircle />
                </InputAdornment>
              ),
            }}
            sx={{ mb: 2 }}
          />
          <FormControl sx={{ mb: 2 }} fullWidth variant="outlined">
            <InputLabel htmlFor="outlined-adornment-password">Mot de passe</InputLabel>
            <OutlinedInput
              id="outlined-adornment-password"
              name="password"
              type={showPassword ? 'text' : 'password'}
              required
              endAdornment={
                <InputAdornment position="end">
                  <IconButton
                    aria-label="toggle password visibility"
                    onClick={() => setShowPassword(!showPassword)}
                    edge="end"
                  >
                    {showPassword ? <VisibilityOff /> : <Visibility />}
                  </IconButton>
                </InputAdornment>
              }
              label="Mot de passe"
            />
          </FormControl>
          <Button
            type="submit"
            variant="contained"
            color="primary"
            fullWidth
            sx={{ mt: 2 }}
            disabled={loading}
          >
            {loading ? 'Création...' : 'Créer le compte'}
          </Button>
          {message && (
            <Typography
              variant="body2"
              color={message.includes('succès') ? 'success' : 'error'}
              sx={{ mt: 2 }}
            >
              {message}
            </Typography>
          )}
          <Link href="/Authentification" variant="body2" sx={{ display: 'block', textAlign: 'center', mt: 2 }}>
            Déjà un compte ? Connectez-vous
          </Link>
        </Box>
      </div>
    </div>
  );
}

export default CreerUtilisateur;
